import React from 'react';

export default function Categories({ handleCategorySelect, categories }) {
  return (
    <>
      <h3>Select A category</h3>
      <div>Active Category: {categories}</div>
      {categories.map((category) => {
        return (
          <button
            className="d-my"
            // style={divStyle}
            key={category}
            onClick={() => handleCategorySelect(category)}
            value={category}
          >
            {category}
          </button>
        );
      })}
    </>
  );
}
